def validTree(n, edges):
    if len(edges) != n - 1:
        return False
    parent = [i for i in range(n)]

    def find(x):
        while parent[x] != x:
            parent[x] = parent[parent[x]]
            x = parent[x]
        return x

    for a, b in edges:
        rootA = find(a)
        rootB = find(b)
        if rootA == rootB:
            return False
        parent[rootA] = rootB
    return True

